    ClientEditMaintenanceComponent.prototype.removeImage = function (index) {
        this.images.slice(index, 1);
        //this.imageFiles.slice(index,1);
        this.images.splice(index, 1);
        var imgFiles = [];
        Array.prototype.push.apply(imgFiles, this.imageFiles);
        imgFiles.splice(index, 1);
        this.imageFiles = imgFiles;
    };
    ClientEditMaintenanceComponent.prototype.imageEvent = function ($event) {
        // if ($event.target.files) {
        //   this.requestModel.photos = $event.target.files[0];
        //   this.readUrl($event.target.files[0]);
        // }
        var existImageLength = this.images.length + $event.target.files.length;
        if (existImageLength > 3 || (this.images.length > 2 || $event.target.files.length >= 4)) {
            alert("Por favor seleccione un máximo de tres imágenes");
            return;
        }
        var picFiles = $event.target.files;
        for (var index = 0; index < picFiles.length; index++) {
            var imageFile = picFiles[index];
            this.imageFiles.push(imageFile);
            this.readUrl(imageFile);
        }
    };
    ClientEditMaintenanceComponent.prototype.readUrl = function (file) {
        var _this = this;
        if (file) {
            var reader = new FileReader();
            //this.imageFileName = file.name;
            reader.onload = function (event) {
                var imgurl = event.target.result;
                _this.images.push(imgurl);
            };
            reader.readAsDataURL(file);
        }
    };
